import React from 'react';
import TextField from 'material-ui/TextField';
import Paper from 'material-ui/Paper';
import RaisedButton from 'material-ui/RaisedButton';
class NewFarmer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
            location: '',
            kissanNumber: ''
        }

    }
    getUserDetails = (e) => {
        const value = e.target.value;
        const name = e.target.name;
        this.setState({
            [name]: value
        });
    }
    render() {
        return (
            <Paper className="loginContianer" zDepth={1}>
            <h3>Register account</h3>
            <div>
            <TextField
            name="name"
                    onChange={this.getUserDetails}
                    hintText="Enter your Name"
                />
                <TextField
                name="location"
                    onChange={this.getUserDetails}
                    hintText="enter your Location"
                />
                <TextField
                name="kissanNumber"
                    onChange={this.getUserDetails}
                    hintText="Enter your kissan number"
                />
                <RaisedButton onClick={this.notify} label="Submit" primary={true} />
                </div>
            }
            <ToastContainer />

        </Paper>
        )
    }
}
export default NewFarmer;
